import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider, useAuth } from './context/AuthContext';
import Navbar from './components/Navbar';
import Login from './pages/Login';
import Register from './pages/Register';
import Home from './pages/Home';
import './App.css';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="app">
          <Navbar />
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/events" element={<EventsPage />} />
            <Route path="/my-registrations" element={<MyRegistrationsPage />} />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

// Simple pages for demo
const EventsPage = () => (
  <div className="page-container">
    <h1>üé™ Browse Events</h1>
    <div className="events-grid">
      <div className="event-card">
        <h3>Tech Conference 2024</h3>
        <p>üìÖ Date: Dec 15, 2024</p>
        <p>‚è∞ Time: 10:00 AM</p>
        <p>üìç Venue: Main Auditorium</p>
        <button className="btn-primary">Register Now</button>
      </div>
      <div className="event-card">
        <h3>Cultural Fest</h3>
        <p>üìÖ Date: Dec 20, 2024</p>
        <p>‚è∞ Time: 2:00 PM</p>
        <p>üìç Venue: College Ground</p>
        <button className="btn-primary">Register Now</button>
      </div>
    </div>
  </div>
);

const MyRegistrationsPage = () => (
  <div className="page-container">
    <h1>üé´ My Registrations</h1>
    <p>You haven't registered for any events yet.</p>
    <button className="btn-primary" onClick={() => window.location.href='/events'}>
      Browse Events
    </button>
  </div>
);

export default App;
